window.bookSummaryJSON = "<p>The Thirteenth Paladin and his companions are finally reunited with each other and have found a worthy ally in the Eternal Empressâ€”another Paladin who will take part in the war against the Adversary. But the effects of Ahren's journey through the empire have left their mark on him. And so, they all set off to Thousand Halls, the original home of the dwarfs, in the hope of finding the mysterious Father of the Mountain who will surely help Ahren in his recovery.</p> <p>If all goes to plan, the nations of Jorath will at last unite and build an alliance against the ever-growing Pall Cloud. Yet Ahren and his companions have underestimated the enemy, for the Dark god has long since prepared a trap, which is only waiting to snap shut on the unsuspecting travelers . . .</p>"; 
